import React from "react";
import { BrowserRouter as Router } from "react-router-dom";
import { Switch, Route, Routes } from "react-router-dom";
import EditorPage from "./EditorPage";
import SharePage from "./SharePage";

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/share/:id">
          <SharePage />
        </Route>
        <Route path="/">
          <EditorPage />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
